    render(){

        return(
            <Iframe
            styles={ {
                width:5,
                position: 'fixed', 
                bottom: 0,
              }}
            scrolling="no" 
            frameborder="0" 
            allowTransparency="true" 
            src="https://www.deezer.com/plugins/player?format=square&autoplay=false&playlist=true&width=100&height=100&color=EF5466&layout=&size=medium&type=playlist&id=3621673922&app_id=1" 
            width="700" 
            height="240">

            </Iframe>
        )
    }
}
export default Widget4;
